import React from "react";
import {
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardImage,
  MDBCardBody,
  MDBBadge,
  MDBContainer
} from "mdbreact";

const EcommercePage = () => {
  return (
    <MDBContainer>
      <MDBRow className="justify-content-center" style={{ padding: "0" }}>
        <MDBCol style={{ maxWidth: "480px", padding: "0" }}>
          <div
            style={{
              height: "100vh",
              backgroundColor: "#F0F0F0",
              textAlign: "center"
            }}
          >
            <br />
            <h1 style={{ color: "#377C4E", fontWeight: "bold" }}>
              Sampah Online
            </h1>
            <br />
            <br />
            <img
              src="https://images.unsplash.com/photo-1503596476-1c12a8ba09a9?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60"
              style={{ width: "200px", borderRadius: "30%" }}
            ></img>
            <br />
            <br />
            <h4>Selamat Datang Sampah Online</h4>
            <h6>
              Apakah kamu siap untuk mendapatkan keuntungan dari sampahmu? Ayo
              Masuk!
            </h6>
          </div>
        </MDBCol>
      </MDBRow>
    </MDBContainer>
  );
};

export default EcommercePage;
